import React from 'react';
import './DynamicGrid.scss'; // Assuming you have a Sass file for styling

interface GridData {
  heading: string;
  content: string;
}

interface DynamicGridProps {
  data: GridData[];
}

const DynamicGrid: React.FC<DynamicGridProps> = ({ data }) => {
  return (
    <div className="dynamic-grid">
      {/* Render the first row as headings */}
      <div className="grid-row header">
        {data.map((cell, columnIndex) => (
          <div key={columnIndex} className="grid-heading">
            {cell.heading}
          </div>
        ))}
      </div>

      {/* Render content for subsequent rows */}
      {data.map((row, rowIndex) => (
        <div key={rowIndex} className="grid-row">
          <div className="grid-content">{row.content}</div>
        </div>
      ))}
    </div>
  );
};

export default DynamicGrid;
